import logo from './logo.svg';
import './App.css';
import {useFormik} from 'formik'

function App() {
  return (
    <div >
      <form>
        <div>Name</div>
        <input id='name' type='text'/>
        <div>Email</div>
        <input id='email' type='text'/>
        <div>Password</div>
        <input id='password' type='text'/>
      </form>
    </div>
  );
}

export default App;
